export default function SobreNosotros() {
    return (
        <div className="row acerca-de align-items-center my-5" id="sobrenosotros">
                <div className="col-12 col-lg-4 foto">
                    <img src="https://images.unsplash.com/photo-1539635278303-d4002c07eae3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80" alt="" className="rounded-circle img-fluid" />
                </div>

                <div className="col-12 col-lg-8 info">
                    <h2 className="titulo text-center my-3">Sobre nosotros</h2>
                    <p className="resumen">Traveling.com apuesta por la tecnología para que viajar sea más fácil. Booking.com conecta a millones de viajeros con experiencias únicas, diversas opciones de transporte y alojamientos increíbles, desde casas hasta hoteles, pasando por otros muchos sitios más. Como una de las plataformas de viajes más grandes del mundo, que reúne tanto a marcas consolidadas como a emprendedores de todos los tamaños, Traveling.com facilita que alojamientos de cualquier lugar del planeta puedan llegar a una audiencia global e impulsar su negocio.</p>
                </div>
             </div>
    )
}
